('SP', 288, 'The Linux Foundation', '2019-06-03 10:47:51', 9825273, 109522, 1795, 'https://yt3.ggpht.com/a/AGF-l7-uLeclZEnyDxF2Mut6cY8-akB_DYjZaPj0qg=s240-mo-c-c0xffffffff-rj-k-no', 'https://www.youtube.com/channel/UCfX55Sx5hEFjoC3cNs6mCUQ', 'TheLinuxFoundation', 5474, '2008-04-01T21:08:18.000Z', 'The Linux Foundation is a nonprofit consortium dedicated to fostering the growth of Linux and collaborative software development. Founded in 2000, the organization sponsors the work of Linux creator Linus Torvalds and promotes, protects and advances the Linux operating system and collaborative software development by marshaling the resources of its members and the open source community. The Linux Foundation provides a neutral forum for collaboration and education by hosting Collaborative Projects, Linux conferences including LinuxCon, and generating original research and content that advances the understanding of Linux and collaborative software development. More information can be found at www.linuxfoundation.org.', 'UCfX55Sx5hEFjoC3cNs6mCUQ', 'UUfX55Sx5hEFjoC3cNs6mCUQ'),
